var imgs = {};

imgs["BOY0"] = new Image();
imgs["GIRL0"] = new Image();
imgs["BOY1"]  = new Image();
imgs["GIRL1"] = new Image();
imgs["RED"] = new Image();
imgs["BLUE"] = new Image();
imgs["GREEN"] = new Image();
imgs["BLOCK"] = new Image();
imgs["BACK"] = new Image();

imgs["BOY0"].src = "data:image/png;base64,";
imgs["GIRL0"].src = "data:image/png;base64,";
imgs["BOY1"].src= "data:image/png;base64,";
imgs["GIRL1"].src = "data:image/png;base64,";
imgs["BLOCK"].src = "data:image/png;base64,";
imgs["RED"].src = "data:image/png;base64,";
imgs["GREEN"].src = "data:image/png;base64,";
imgs["BLUE"].src = "data:image/png;base64,";
imgs["BACK"].src = "data:image/png;base64,";

var log_arr = [];
var Types_ = {};

const Player_ = 1;
const Block_ = 2;
const Balloon_ = 3;
var x = 0;
var c = document.getElementById("log_viewer_canvas");
var ctx = c.getContext("2d");
var obs = [];
var cell_size = 32;
var log_last_index = 0;
var turn_start_time = 0;
var first_turn_lndex = -1;
var anim_dur = 350;

Types_["BOY0"] = Player_;
Types_["GIRL0"] = Player_;
Types_["BOY1"] =  Player_;
Types_["GIRL1"] = Player_;
Types_["RED"] = Balloon_;
Types_["BLUE"] = Balloon_;
Types_["GREEN"] = Balloon_;
Types_["BLOCK"] = Block_;

function Anim(dx, dy, r, k) {
	this.dx = dx;
	this.dy = dy;
	this.r = r;
	this.k = k;
}

function my_obj(img, x, y, k, type) {
	this.init(img, x, y, k, type);
}

my_obj.prototype.init = function(img, x, y, k, type) {
	this.x = x;
	this.y = y;
	this.type = type;
	this.scale = k;
	this.img = img;
	this.tran_arr = [];
	this.last_ind = -1;
	this.cu_anim = undefined;
	this.r = 0;
	this.que = [];
	this.dom = 8;
	if(this.type == Balloon_) {
		this.dom = 3;
	}
	this.an_start_time = 0;
	this.time = new Date();
	this.ra = Math.floor(Math.random()  * ( 2 * this.dom + 1)) - this.dom;
	this.fer_dir = 1;
	if(Math.random() > 0.5) {
		this.fer_dir = -1;
	}
};

my_obj.prototype.add_anim = function(tran) {
	this.last_ind = this.last_ind + 1;
	this.tran_arr[last_ind] = tran;
};

my_obj.prototype.add_anim = function(anim) {
	this.que.push(anim);
};

my_obj.prototype.check_new_anim = function() {
	var dt = this.time.getTime() - this.an_start_time;
	if(this.cu_anim === undefined || dt >= anim_dur) {
		if(this.cu_anim !== undefined) {
			this.x = this.x + this.cu_anim.dx;
			this.y = this.y + this.cu_anim.dy;
			this.r = this.r + this.cu_anim.r;
			this.scale = this.scale + this.cu_anim.k;
		}
		this.cu_anim = undefined;
		this.an_start_time = this.time.getTime();
		if(this.que.length > 0) {
			this.cu_anim = this.que.shift();
		} else {
			this.cu_anim = new Anim(0, 0, 0, 0);
		}
	}
	if(this.cu_anim === undefined) {
		this.cu_anim = new Anim(0, 0, 0, 0);
	}
};

my_obj.prototype.get_anim_factor = function(){
	var f = (this.time.getTime() - this.an_start_time) / anim_dur;
	if(f >= 1 - 0.01) {
		f = 1;
	}
	return f;
};

my_obj.prototype.draw = function(ctx){
	
	this.time = new Date();
	this.check_new_anim();
	var factor = this.get_anim_factor();
	if(this.type == Block_) {
		sh = 0;
	} else {
		if(this.ra > this.dom || this.ra < (0 - this.dom)) {
			this.fer_dir *= -1;
			
		}
		if(this.type == Player_) {
			this.ra = this.ra + this.fer_dir * 2;
		} else {
			this.ra = this.ra + this.fer_dir;
		}
		sh = this.ra;
	}

	var k = this.scale + this.cu_anim.k * factor;
	var r = this.r + this.cu_anim.r * factor + sh;
	var w = this.img.width * (k);
	var h = this.img.height * (k);
	var cx = this.x + ( this.cu_anim.dx * factor);
	var cy = this.y + ( this.cu_anim.dy * factor);
	
	var move_up = 0;
	if(this.type == Balloon_) {
		move_up = h / 2 - (cell_size / 3) * k;
	}
	
	ctx.save();
	ctx.translate(cx , cy );
	ctx.rotate(r * Math.PI / 180);
	ctx.translate(-(cx ), -(cy ));
	ctx.drawImage(this.img,  cx - w / 2, cy - h/ 2 - move_up, w, h);
	ctx.restore();
};

function draw_type(type) {
	for(var i in obs) {
		ob = obs[i];
		if(ob.type == type) {
			obs[i].draw(ctx);
		}
	}
}

function draw() {
	check_for_new_turn();
	ctx.fillStyle="green";
	ctx.fillRect(0, 0, 1000, 800);
	ctx.lineWidth = 0.5;
	ctx.strokeStyle = '#71ad2c';
	var back_img = imgs["BACK"];
	for(var i = 0; i < 25; i++) {
		for(var j = 0; j < 25; j++) {
			ctx.drawImage(back_img,  i * 32, j * 32);
		}
	}
	for(var i = 0; i < 25; i++) {
		ctx.beginPath();
		ctx.moveTo(0, i * 32);
		ctx.lineTo(800, i * 32);
		ctx.stroke();
	}
	for(var i = 0; i < 25; i++) {
		ctx.beginPath();
		ctx.moveTo(i * 32, 0);
		ctx.lineTo(i * 32, 800);
		ctx.stroke();
	}
	draw_type(Block_);
	draw_type(Player_);
	draw_type(Balloon_);
	window.requestAnimationFrame(draw);
}

function row_to_pix(row) {
	return row * cell_size + cell_size / 2;
}

function col_to_pix(col) {
	return col * cell_size + cell_size / 2;
}

function new_obj(info_arr) {
	var img = info_arr[1];
	var id = parseInt(info_arr[2]);
	var row = parseInt(info_arr[3]);
	var col = parseInt(info_arr[4]);
	var size = parseInt(info_arr[5]);
	if(Types_[img] == Balloon_) {
		size = 0.3;
	}
	var ob = obs[id];
	if(ob == undefined) {
		obs[id] = new my_obj(imgs[img], col_to_pix(col), row_to_pix(row), size, Types_[img]);
	} else {
		ob.init(imgs[img], col_to_pix(col), row_to_pix(row), size, Types_[img]);
	}
}

function check_for_new_turn() {
	var time = new Date();
	var dt = time.getTime() - turn_start_time;
	if(dt > 350 + 10) {
		continue_log();
	}
}

function add_anim(info_arr) {
	var id = info_arr[1];
	var drow = parseInt(info_arr[2]) * cell_size;
	var dcol = parseInt(info_arr[3]) * cell_size;
	var dr = parseFloat(info_arr[4]);
	var ds = parseFloat(info_arr[5]);
	obs[id].add_anim(new Anim(dcol, drow, dr, ds * 3));
}

function del_obj(info_arr) {
	var id = info_arr[1];
	delete obs[id];
}

function continue_log() {
	var len = log_arr.length;
	var i = log_last_index;
	var L;
	var break_ = false;
	for(i = log_last_index; i < len; i++) {
		L = log_arr[i].split(" ");
		switch(L[0]) {
			case "N" : {
				new_obj(L);
				break;
			}
			case "T" : {
				if(first_turn_lndex == -1) {
					first_turn_lndex = i;
				}
				break_ = true;
				break;
			}
			case "A": {
				add_anim(L);
				break;
			}
			case "D": {
				del_obj(L);
				break;
			}
			case "End": {
				log_last_index = 0;
				return;
				break;
			}
		}
		if(break_) {
			i++;
			break;
		}
	}
	var time = new Date();
	turn_start_time = time.getTime();
	log_last_index = i;
}

function play(log) {
	log_arr = log;
	log_last_index = 0;
	continue_log();
	draw();
}

ctx.fillStyle = "green";
ctx.fillRect(0, 0, 800, 600);